window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"version":"11.1.1","name":"cucumber-js"},"cpu":{"name":"x64"},"os":{"name":"win32","version":"10.0.19045"},"runtime":{"name":"node.js","version":"20.17.0"}}},{"source":{"data":"Feature: Gestión de Dueños y Mascotas en Petclinic\r\n\r\n    Background:\r\n        Given que estoy en la página principal\r\n\r\n    @GetListOwner\r\n    Scenario: Acceso Principal y Mostrar Lista de Owners\r\n        Given que me dirigo al menú de find owners\r\n        When accedo a la lista de owners\r\n        Then debo ver una lista de todos los owners de mascotas registrados correctamente\r\n\r\n    @AddOwner\r\n    Scenario: Ingresar un Nuevo Owner\r\n        Given que me dirigo al menú de find owners\r\n        When selecciono agregar owner\r\n        And registro el owner en el formulario con los datos\r\n            | firstName | lastName      | address          | city  | phone      |\r\n            | FabiXB     | Alama Sanchez | Av. Buenos Aires | Piura | 9331569950 |\r\n        And que me dirigo al menú de find owners\r\n        And accedo a la lista de owners\r\n        Then el nuevo owner \"FabiXA Alama Sanchez\" debe aparecer correctamente en la lista de owners\r\n\r\n# Scenario: Buscar y Editar un Owner\r\n#     Given que estoy en la lista de dueños\r\n#     When busco al dueño que quiero editar\r\n#     And selecciono el dueño para hacer clic en \"Editar\"\r\n#     And cambio uno de los datos (por ejemplo, el nombre)\r\n#     Then los cambios deben guardarse correctamente y mostrarse en la lista de dueños\r\n\r\n# Scenario: Agregar 2 Pets a un Owner y Validar que Aparezcan en la Lista de Pets\r\n#     Given que estoy en el perfil del dueño\r\n#     When selecciono la opción para agregar mascotas\r\n#     And completo el formulario con la información de la primera y la segunda mascota (nombre, especie, edad, etc.)\r\n#     And hago clic en \"Guardar\" o \"Añadir\"\r\n#     Then las mascotas deben aparecer correctamente en la lista de mascotas del dueño\r\n\r\n# Scenario: Escoger un Pet y Agregar una Visita, Validar que Aparezca en el Listado de Visitas\r\n#     Given que estoy en el perfil de la mascota\r\n#     When selecciono la opción para agregar una visita\r\n#     And completo el formulario con la fecha, descripción y otros detalles relevantes\r\n#     And hago clic en \"Guardar\" o \"Añadir visita\"\r\n#     Then la visita debe aparecer correctamente en la lista de visitas asociadas a la mascota\r\n\r\n# Scenario: Editar un Pet del Listado\r\n#     Given que estoy en la lista de mascotas\r\n#     When selecciono la mascota que quiero editar\r\n#     And realizo cambios en los datos (por ejemplo, el nombre, la especie, la edad)\r\n#     And hago clic en \"Guardar\" o \"Actualizar\"\r\n#     Then los cambios deben aplicarse correctamente y mostrarse en el perfil de la mascota","uri":"src\\test\\features\\petclinic.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Gestión de Dueños y Mascotas en Petclinic","description":"","children":[{"background":{"id":"2e11fe0b-80f6-46ea-9dfb-cf54499475ec","location":{"line":3,"column":5},"keyword":"Background","name":"","description":"","steps":[{"id":"6cfc0662-a7c6-43f6-9f8c-cec83bb473c7","location":{"line":4,"column":9},"keyword":"Given ","keywordType":"Context","text":"que estoy en la página principal"}]}},{"scenario":{"id":"49806645-36ce-43dc-aad8-2d79ae6881f1","tags":[{"location":{"line":6,"column":5},"name":"@GetListOwner","id":"25ff910f-a0b4-4ec3-b39c-d36909f31865"}],"location":{"line":7,"column":5},"keyword":"Scenario","name":"Acceso Principal y Mostrar Lista de Owners","description":"","steps":[{"id":"97b60404-0a7e-488d-954b-6bf37d6d9570","location":{"line":8,"column":9},"keyword":"Given ","keywordType":"Context","text":"que me dirigo al menú de find owners"},{"id":"a29a10cb-63c3-442
